      out.write("\t\t\t\t\t\t\t\t\t2、原产地及制造商：深圳市飞鸿光电子有限公司 \r\n");
      out.write("&lt;br&gt;\r\n");
      out.write("&lt;p&gt;3、包装方式：适合长途运输，具有防振，防碰撞能力&lt;/p&gt;\r\n");
      out.write("&lt;p&gt;4、交货日期、交货地址及收货单位：在合同签订后 　天或在  2012 年   3   月  31    日发货至需方所在地 。&lt;/p&gt;\r\n");
      out.write("&lt;p&gt;5、运输方式：　□ 汽运    □ 运费由需方承担 &lt;/p&gt;\r\n");
      out.write("&lt;p&gt;6、付款方式： 款到发货&lt;/p&gt;\r\n");
      out.write("&lt;p&gt;7、开据税票的种类：　　无&lt;/p&gt;\r\n");
      out.write("&lt;p&gt;8、因甲方产品的质量问题造成产品不符合要求的，乙方可在收货日起一周内提出更换&lt;/p&gt;\r\n");
      out.write("&lt;p&gt;9、不可抗力&lt;/p&gt;\r\n");
      out.write("&lt;p&gt;    任何一方由于不可抗力的原因不能履行合同时，应及时向对方通报不能履行的理由，在取得有关机构证明后，允许延期履行、部分履行或者终止履行，并根据情况免予承担部分或者全部违约责任。&lt;/p&gt;\r\n");
      out.write("&lt;p&gt;10、解决争议方式：&lt;/p&gt;\r\n");
      out.write("&lt;p&gt;    本合同在履行过程中如发生争议，应友好协商解决，双方不能协商时，任何一方均可向甲方所在地人民法院提起诉讼。&lt;/p&gt;\r\n");
